import React, { Component } from 'react';

class Weather extends Component {
  render() {
    return (
      <div className="col-2">
        <div className="tile">
          <div className="bar"></div>
          <div className="text">
            <div>Weather</div>
            <div className="tile-icon">
              <i className="fas fa-cloud op"></i>
            </div>
            <div></div>
          </div>
        </div>
      </div>
    );
  }
}

export default Weather;
